        { title: 'Welcome party!', body: 'lorem ipsum...', author: 'yoshi', id: 2 },
        { title: 'Web dev top tips', body: 'lorem ipsum...', author: 'tayealabi', id: 3 }
      ])

    return ( 
        <div className="home">
            {
                <BlogList blogs={blogs} />
            }
        </div>
     );
}

export default Home;
